import React, { useState, useEffect } from 'react';
import { 
  FaPhone, 
  FaEnvelope, 
  FaMapMarkerAlt, 
  FaFacebook, 
  FaInstagram, 
  FaTwitter, 
  FaLinkedin,
  FaSpinner
} from 'react-icons/fa';
import { Link } from 'react-router-dom';
import './ContactPage.css';

const ContactPage = () => {
  const [isIframeLoading, setIsIframeLoading] = useState(true);
  const [isScriptLoaded, setIsScriptLoaded] = useState(false);

  useEffect(() => {
    // Load Brevo form script
    const script = document.createElement('script');
    script.src = 'https://sibforms.com/forms/end-form/build/sib-forms.sandbox.js';
    script.async = true;

    script.onload = () => {
      setIsScriptLoaded(true);
      // Small delay to ensure the script is fully initialized
      setTimeout(() => setIsIframeLoading(false), 1500);
    };

    script.onerror = () => {
      console.error('Failed to load Brevo form script');
      setIsIframeLoading(false);
    };

    document.body.appendChild(script);

    // Cleanup
    return () => {
      if (document.body.contains(script)) {
        document.body.removeChild(script);
      }
    };
  }, []);

  const handleIframeLoad = () => {
    setIsIframeLoading(false);
  };

  const contactMethods = [
    {
      icon: <FaPhone />,
      title: 'Phone',
      content: (
        <a href="tel:+919628912345" className="contact-link">
          +91 96289 12345
        </a>
      )
    },
    {
      icon: <FaEnvelope />,
      title: 'Email',
      content: (
        <a href="mailto:info@navigatioasia.com" className="contact-link">
          info@navigatioasia.com
        </a>
      )
    },
    {
      icon: <FaMapMarkerAlt />,
      title: 'Location',
      content: 'Mumbai, India'
    }
  ];

  const socialLinks = [
    { icon: <FaFacebook />, label: 'Facebook', url: '#' },
    { icon: <FaInstagram />, label: 'Instagram', url: '#' },
    { icon: <FaTwitter />, label: 'Twitter', url: '#' },
    { icon: <FaLinkedin />, label: 'LinkedIn', url: '#' }
  ];

  return (
    <div className="contact-page">
      <div className="contact-hero">
        <div className="container">
          <h1>Get In Touch</h1>
          <p>We'd love to hear from you. Reach out to us for any inquiries or to book your next adventure.</p>
        </div>
      </div>

      <div className="contact-content">
        <div className="container">
          <div className="contact-grid">
            <div className="contact-info">
              <h2>Contact Information</h2>
              <p>Feel free to get in touch with us through any of the following channels:</p>

              <div className="contact-methods">
                {contactMethods.map((method, index) => (
                  <div 
                    key={index} 
                    className="contact-method"
                    tabIndex="0"
                    aria-label={`${method.title}: ${typeof method.content === 'string' ? method.content : method.content.props.children}`}
                  >
                    <div className="contact-icon" aria-hidden="true">
                      {method.icon}
                    </div>
                    <div className="contact-method-content">
                      <h3>{method.title}</h3>
                      <div>{method.content}</div>
                    </div>
                  </div>
                ))}
              </div>

              <div className="social-links">
                {socialLinks.map((social, index) => (
                  <a 
                    key={index}
                    href={social.url} 
                    aria-label={social.label}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="social-link"
                  >
                    {social.icon}
                    <span className="sr-only">{social.label}</span>
                  </a>
                ))}
              </div>
            </div>

            <div className="contact-form-container">
              <h2>Send Us a Message</h2>
              <p>Have questions or special requests? We're here to help.</p>

              <div className={`form-iframe-wrapper ${isIframeLoading ? 'loading' : ''}`}>
                {isIframeLoading && (
                  <div className="form-loading">
                    <FaSpinner className="spinner" />
                    <p>Loading contact form...</p>
                  </div>
                )}
                <iframe 
                  src="https://359f261a.sibforms.com/serve/MUIFANWF04W7ZTZHcoxLeX1YqC1hqEVgRJf0rioHDC6x8b7ShBDdRNv5n4DVszydlV_7E_YRNki18RujaTxcPgIPcAdcrEXSxVlBQn8Ecw1xeGZ1V_Lg8VEzuUD-6LIeRuDT-c9LDDMIsgD0WNIxtT_0kP2sDH8lmyMy304jq5w6lBJExtIJtXe6XTzuSrJIf-NwXtxtxzmnFjP2"
                  title="Contact Form"
                  onLoad={handleIframeLoad}
                  style={{ 
                    opacity: isIframeLoading ? 0 : 1,
                    transition: 'opacity 0.3s ease-in-out',
                    width: '100%',
                    minHeight: '500px',
                    border: 'none',
                    borderRadius: '12px'
                  }}
                  loading="lazy"
                  aria-label="Contact form"
                />
              </div>

              <div className="form-note">
                <p>We typically respond within 24 hours. For urgent inquiries, please call us directly.</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactPage;
